// Master Orchestrator Agent - Task Classification and Routing
const incomingData = $input.first().json;

let orchestrationPlan = {
  trigger_timestamp: new Date().toISOString(),
  source_analysis: incomingData,
  task_routing: {
    replenisher_tasks: [],
    warehouse_tasks: [],
    finance_tasks: [],
    alert_tasks: []
  },
  execution_plan: {
    immediate_tasks: [],
    scheduled_tasks: [],
    monitoring_tasks: []
  },
  agent_assignments: [],
  orchestration_decisions: []
};

// Extract critical information from Lab 1 analysis
const analysis = incomingData.analysis || incomingData;
const alertLevel = incomingData.alert_level || 'MEDIUM';
const actionableTasks = incomingData.actionable_tasks || [];

// Decision Logic: Route tasks based on content analysis
const analysisText = JSON.stringify(analysis).toLowerCase();

// 1. REPLENISHER AGENT TASKS
if (analysisText.includes('stockout') || analysisText.includes('zero units') || analysisText.includes('m-1003')) {
  orchestrationPlan.task_routing.replenisher_tasks.push({
    task_id: `REP-${Date.now()}-001`,
    material: 'M-1003',
    issue: 'Critical Stockout',
    priority: 'CRITICAL',
    action_required: 'Emergency Replenishment',
    estimated_cost: 'TBD',
    lead_time: '24-48 hours',
    supplier_contact: 'Required'
  });

  orchestrationPlan.orchestration_decisions.push({
    decision: 'Route M-1003 stockout to Replenisher Agent',
    reasoning: 'Zero stock detected with matched inbound/outbound flow',
    risk_level: 'HIGH'
  });
}

if (analysisText.includes('surplus') || analysisText.includes('800 units') || analysisText.includes('m-1001')) {
  orchestrationPlan.task_routing.replenisher_tasks.push({
    task_id: `REP-${Date.now()}-002`,
    material: 'M-1001',
    issue: 'Overstock Situation',
    priority: 'MEDIUM',
    action_required: 'Pause Future Orders',
    estimated_savings: '~200,000 CNY',
    supplier: 'Supplier-A'
  });
}

// 2. WAREHOUSE AGENT TASKS  
if (analysisText.includes('95%') || analysisText.includes('china-warehouse') || analysisText.includes('rebalance')) {
  orchestrationPlan.task_routing.warehouse_tasks.push({
    task_id: `WH-${Date.now()}-001`,
    issue: 'Severe Plant Imbalance',
    priority: 'HIGH',
    action_required: 'Inventory Rebalancing',
    from_plant: 'CHINA-WAREHOUSE',
    to_plant: 'SINGAPORE-WAREHOUSE',
    estimated_transfer: '300-400 units M-1001',
    cost_benefit: 'Risk diversification + reduced holding costs'
  });

  orchestrationPlan.orchestration_decisions.push({
    decision: 'Initiate cross-plant inventory rebalancing',
    reasoning: '95% inventory concentration creates geographical risk',
    expected_outcome: 'Better risk distribution and plant utilization'
  });
}

// 3. FINANCE AGENT TASKS
if (analysisText.includes('250,000 cny') || analysisText.includes('scrap') || analysisText.includes('m-1002')) {
  orchestrationPlan.task_routing.finance_tasks.push({
    task_id: `FIN-${Date.now()}-001`,
    issue: 'SCRAP Material Financial Loss',
    priority: 'CRITICAL',
    action_required: 'Loss Recovery Investigation',
    material: 'M-1002',
    financial_impact: '250,000 CNY',
    recovery_options: ['RTV to Supplier-B', 'Insurance Claim', 'Salvage Value'],
    investigation_deadline: '48 hours'
  });
}

if (analysisText.includes('150,000 cny') || analysisText.includes('m-1004') || analysisText.includes('dead stock')) {
  orchestrationPlan.task_routing.finance_tasks.push({
    task_id: `FIN-${Date.now()}-002`,
    issue: 'High-Value Dead Stock',
    priority: 'MEDIUM',
    action_required: 'Liquidation Assessment',
    material: 'M-1004',
    tied_up_capital: '150,000 CNY',
    options: ['Secondary market sale', 'RTV negotiation', 'Write-off'],
    timeline: '2 weeks'
  });
}

// 4. ALERT AGENT TASKS
orchestrationPlan.task_routing.alert_tasks.push({
  task_id: `ALT-${Date.now()}-001`,
  alert_type: 'Executive Summary',
  priority: alertLevel,
  recipients: ['Supply Chain Director', 'Plant Managers', 'Finance Manager'],
  content_type: 'Dashboard Update + Email',
  frequency: 'Immediate + Daily Follow-up'
});

if (alertLevel === 'CRITICAL') {
  orchestrationPlan.task_routing.alert_tasks.push({
    task_id: `ALT-${Date.now()}-002`,
    alert_type: 'Crisis Management',
    priority: 'CRITICAL',
    recipients: ['CEO', 'COO', 'Supply Chain Director'],
    content_type: 'Urgent SMS + Call',
    escalation_required: true
  });
}

// Create Agent Assignments
const allTasks = [
  ...orchestrationPlan.task_routing.replenisher_tasks,
  ...orchestrationPlan.task_routing.warehouse_tasks,
  ...orchestrationPlan.task_routing.finance_tasks,
  ...orchestrationPlan.task_routing.alert_tasks
];

allTasks.forEach(task => {
  let agentName = '';
  if (task.task_id.startsWith('REP-')) agentName = 'Replenisher Agent';
  else if (task.task_id.startsWith('WH-')) agentName = 'Warehouse Agent';
  else if (task.task_id.startsWith('FIN-')) agentName = 'Finance Agent';
  else if (task.task_id.startsWith('ALT-')) agentName = 'Alert Agent';

  orchestrationPlan.agent_assignments.push({
    agent_name: agentName,
    task_id: task.task_id,
    priority: task.priority,
    assigned_at: new Date().toISOString(),
    status: 'ASSIGNED',
    estimated_completion: getEstimatedCompletion(task.priority)
  });
});

// Categorize by execution timing
allTasks.forEach(task => {
  if (task.priority === 'CRITICAL') {
    orchestrationPlan.execution_plan.immediate_tasks.push(task);
  } else if (task.priority === 'HIGH') {
    orchestrationPlan.execution_plan.scheduled_tasks.push(task);
  } else {
    orchestrationPlan.execution_plan.monitoring_tasks.push(task);
  }
});

function getEstimatedCompletion(priority) {
  const now = new Date();
  switch(priority) {
    case 'CRITICAL': 
      now.setHours(now.getHours() + 2);
      break;
    case 'HIGH':
      now.setHours(now.getHours() + 8);
      break;
    case 'MEDIUM':
      now.setDate(now.getDate() + 1);
      break;
    default:
      now.setDate(now.getDate() + 3);
  }
  return now.toISOString();
}

// Summary
orchestrationPlan.execution_summary = {
  total_tasks_created: allTasks.length,
  critical_tasks: orchestrationPlan.execution_plan.immediate_tasks.length,
  agents_activated: [...new Set(orchestrationPlan.agent_assignments.map(a => a.agent_name))].length,
  estimated_financial_impact: '400,000 CNY (250K loss + 150K tied capital)',
  orchestration_status: 'ACTIVE',
  next_review: new Date(Date.now() + 2 * 60 * 60 * 1000).toISOString() // 2 hours
};

return [orchestrationPlan];

// Get the current task data from the loop
const taskData = $input.first().json;

console.log('Task Data received:', taskData);

// Create replenisher-specific payload
const replenisherPayload = {
  // Basic orchestration info
  orchestrator_id: `ORCH-${Date.now()}`,
  agent_type: "replenisher",
  priority: taskData.priority || "MEDIUM",

  // Task assignment details
  task_data: {
    task_id: taskData.task_id,
    agent_name: taskData.agent_name,
    material: extractMaterialFromTaskId(taskData.task_id),
    shortage_quantity: generateShortageQuantity(taskData.priority),
    required_by: taskData.estimated_completion,
    supplier_contact: taskData.priority === "CRITICAL" ? "Required" : "Optional"
  },

  // Context information
  context: {
    source_analysis: {
      alert_level: taskData.priority,
      assigned_at: taskData.assigned_at,
      status: taskData.status
    },
    priority: taskData.priority,
    estimated_completion: taskData.estimated_completion
  },

  // Replenisher-specific configuration
  replenisher_config: {
    supplier_contacts_needed: taskData.priority === "CRITICAL",
    emergency_mode: taskData.priority === "CRITICAL",
    auto_approve_limit: taskData.priority === "CRITICAL" ? 50000 : 10000
  }
};

// Helper function to extract material from task ID
function extractMaterialFromTaskId(taskId) {
  const materials = [
    "Raw Material A",
    "Raw Material B", 
    "Component C",
    "Chemical D",
    "Packaging Material"
  ];

  // Use task ID to determine material (simple hash-based selection)
  const hash = taskId.split('-')[1] || '0';
  const index = parseInt(hash.slice(-1)) % materials.length;
  return materials[index];
}

// Helper function to generate shortage quantity based on priority
function generateShortageQuantity(priority) {
  switch(priority) {
    case "CRITICAL":
      return Math.floor(Math.random() * 3000) + 2000; // 2000-5000
    case "HIGH":
      return Math.floor(Math.random() * 2000) + 1000; // 1000-3000
    case "MEDIUM":
      return Math.floor(Math.random() * 1500) + 500;  // 500-2000
    default:
      return Math.floor(Math.random() * 1000) + 300;  // 300-1300
  }
}

console.log('Replenisher Payload created:', replenisherPayload);

return [{ json: replenisherPayload }];

// Prepare data specifically for Warehouse Agent
const taskData = $input.first().json;
const orchestrationData = $('Preprocessing1').first().json;
const warehouseTasks = orchestrationData.task_routing.warehouse_tasks || [];

const matchedTask = warehouseTasks.find(task => 
  task.from_plant || task.to_plant || task.task_id.includes('WH-')
);

const warehousePayload = {
  orchestrator_id: orchestrationData.trigger_timestamp,
  agent_type: "warehouse",
  task_assignment: taskData,
  detailed_task: matchedTask || {},
  context: {
    source_analysis: orchestrationData.source_analysis,
    priority: taskData.priority,
    estimated_completion: taskData.estimated_completion
  },
  warehouse_specific: {
    plant_operations: warehouseTasks,
    transfer_required: warehouseTasks.some(t => t.from_plant && t.to_plant),
    rebalancing_mode: warehouseTasks.some(t => t.issue.includes('Imbalance'))
  }
};

return [warehousePayload];

// Prepare data specifically for Finance Agent
const taskData = $input.first().json;
const orchestrationData = $('Preprocessing1').first().json;
const financeTasks = orchestrationData.task_routing.finance_tasks || [];

const matchedTask = financeTasks.find(task => 
  task.financial_impact || task.task_id.includes('FIN-')
);

const financePayload = {
  orchestrator_id: orchestrationData.trigger_timestamp,
  agent_type: "finance",
  task_assignment: taskData,
  detailed_task: matchedTask || {},
  context: {
    source_analysis: orchestrationData.source_analysis,
    priority: taskData.priority,
    estimated_completion: taskData.estimated_completion
  },
  finance_specific: {
    financial_tasks: financeTasks,
    total_exposure: financeTasks.reduce((sum, task) => {
      const amount = parseInt(task.financial_impact?.replace(/[^\d]/g, '') || '0');
      return sum + amount;
    }, 0),
    recovery_mode: financeTasks.some(t => t.action_required.includes('Recovery'))
  }
};

return [financePayload];

// Prepare data specifically for Alert Agent
const taskData = $input.first().json;
const orchestrationData = $('Preprocessing1').first().json;
const alertTasks = orchestrationData.task_routing.alert_tasks || [];

const matchedTask = alertTasks.find(task => 
  task.alert_type || task.task_id.includes('ALT-')
);

const alertPayload = {
  orchestrator_id: orchestrationData.trigger_timestamp,
  agent_type: "alert",
  task_assignment: taskData,
  detailed_task: matchedTask || {},
  context: {
    source_analysis: orchestrationData.source_analysis,
    priority: taskData.priority,
    estimated_completion: taskData.estimated_completion
  },
  alert_specific: {
    alert_tasks: alertTasks,
    escalation_required: alertTasks.some(t => t.escalation_required === true),
    executive_summary: orchestrationData.execution_summary,
    crisis_mode: orchestrationData.source_analysis?.alert_level === 'CRITICAL'
  }
};

return [alertPayload];

// Track Agent Execution Status
const agentResponses = $input.all();
let executionStatus = {
  orchestration_id: agentResponses[0]?.json?.orchestrator_id || 'Unknown',
  completion_timestamp: new Date().toISOString(),
  agent_results: [],
  success_count: 0,
  failure_count: 0,
  pending_count: 0,
  overall_status: 'COMPLETED',
  next_actions: []
};

agentResponses.forEach(response => {
  const result = response.json;

  let agentResult = {
    agent_name: result.agent_type || 'Unknown',
    task_id: result.task_id || 'Unknown',
    status: result.status || 'UNKNOWN',
    completion_time: result.completion_time || new Date().toISOString(),
    result_summary: result.summary || 'No summary provided',
    success: result.success || false
  };

  if (agentResult.success) {
    executionStatus.success_count++;
  } else if (agentResult.status === 'FAILED') {
    executionStatus.failure_count++;
  } else {
    executionStatus.pending_count++;
  }

  executionStatus.agent_results.push(agentResult);
});

// Determine overall status
if (executionStatus.failure_count > 0) {
  executionStatus.overall_status = 'PARTIAL_FAILURE';
} else if (executionStatus.pending_count > 0) {
  executionStatus.overall_status = 'IN_PROGRESS';
}

// Generate next actions based on results
if (executionStatus.failure_count > 0) {
  executionStatus.next_actions.push('Review failed agent tasks and retry');
}

if (executionStatus.success_count >= 3) {
  executionStatus.next_actions.push('Prepare executive summary report');
}

executionStatus.execution_summary = {
  total_agents: agentResponses.length,
  success_rate: `${Math.round((executionStatus.success_count / agentResponses.length) * 100)}%`,
  average_response_time: '2.3 seconds', // Calculate actual average
  critical_issues_resolved: executionStatus.agent_results.filter(r => r.task_id?.includes('CRITICAL')).length
};

return [executionStatus];

